import React, { Fragment } from 'react';
import { Card, CardHeader, Col, Container, Row } from 'reactstrap';
import "./styles.css";

const SubmitProgressUpdatesForEmployerHelper = (props) => {
    return (
        <Fragment>
            <Breadcrumb parent="Manage This Active Job & Submit A Report!" title="Submit A Report Or Follow Up On A Previous Report.." />
            <Container fluid={true}>
                <Row>
                    <Col sm="12" lg="12" md="12" xl="12">
                        <Card className='shadow'>
                            <CardHeader className='b-l-info b-r-info'>
                                <h3 className='header-submit-report'>You're about to submit a report to EXNESS. Provide as much information as possible about the potential issue you have discovered. The more information you provide, the quicker EXNESS will be able to validate the issue. If you haven't yet, please remember to review our Policy and Disclosure Guidelines.</h3>
                            </CardHeader>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default SubmitProgressUpdatesForEmployerHelper;
